import { Navbar, Nav, Container } from 'react-bootstrap';
import './Navigation.css';

const Navigation = () => {
    return (
        <Navbar className="navbar">
            <Navbar.Brand>NAVBAR</Navbar.Brand>
            <Container>
                <Nav>
                    <li>
                        <Nav.Link>Home</Nav.Link>
                    </li>
                    <li>
                        <Nav.Link>Page</Nav.Link>
                    </li>
                </Nav>
            </Container>
        </Navbar>
    )
}



export default Navigation;
